import React, { useState } from "react";
import Input from "./Input";
import InputText from "./InputText";
import InputEmail from "./InputEmail";
import InputPassword from "./InputPassword";
import InputTel from "./InputTel";
import InputURL from "./InputURL";
import InputSearch from "./InputSearch";
import Boton from "./Boton";

function Formulario() {
  const [formulario, setFormulario] = useState({
    nombre: "",
    edad: "",
    fechaNacimiento: "",
    telefono: "",
    email: "",
    password: "",
    url: "",
    busqueda: "",
  });

  const manejarCambio = (e) => {
    const { name, value } = e.target;
    setFormulario({ ...formulario, [name]: value });
  };

  const manejarEnvio = (e) => {
    e.preventDefault();
    alert(`Datos ingresados:

Nombre: ${formulario.nombre}
Edad: ${formulario.edad}
Fecha de nacimiento: ${formulario.fechaNacimiento}
Teléfono: ${formulario.telefono}
Correo: ${formulario.email}
Contraseña: ${formulario.password}
URL: ${formulario.url}
Búsqueda: ${formulario.busqueda}`);
  };

  return (
    <form className="card p-4 shadow" onSubmit={manejarEnvio}>
      <h4 className="text-center mb-4">Formulario de Inscripción</h4>

      <div className="mb-3">
        <InputText
          placeholder="Nombre completo"
          name="nombre"
          value={formulario.nombre}
          onChange={manejarCambio}
        />
      </div>

      <div className="mb-3">
        <Input
          type="number"
          placeholder="Edad"
          name="edad"
          value={formulario.edad}
          onChange={manejarCambio}
        />
      </div>

      <div className="mb-3">
        <Input
          type="date"
          placeholder="Fecha de nacimiento"
          name="fechaNacimiento"
          value={formulario.fechaNacimiento}
          onChange={manejarCambio}
        />
      </div>

      <div className="mb-3">
        <InputTel
          placeholder="Teléfono"
          name="telefono"
          value={formulario.telefono}
          onChange={manejarCambio}
        />
      </div>

      <div className="mb-3">
        <InputEmail
          placeholder="Correo electrónico"
          name="email"
          value={formulario.email}
          onChange={manejarCambio}
        />
      </div>

      <div className="mb-3">
        <InputPassword
          placeholder="Contraseña"
          name="password"
          value={formulario.password}
          onChange={manejarCambio}
        />
      </div>

      <div className="mb-3">
        <InputURL
          placeholder="Sitio web personal"
          name="url"
          value={formulario.url}
          onChange={manejarCambio}
        />
      </div>

      <div className="mb-3">
        <InputSearch
          placeholder="Buscar..."
          name="busqueda"
          value={formulario.busqueda}
          onChange={manejarCambio}
        />
      </div>

      <div className="text-center">
        <Boton texto="Enviar" type="submit" />
      </div>
    </form>
  );
}

export default Formulario;
